import './App.js'
import createSudoku from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
const root=ReactDOM.createRoot(document.getElementById('root'));
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props)

     }
     render(){
      return(
        this.props.arr.map((temp)=><div className='Sudoku'><Row arra={temp}/><br/></div>)
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=><><h className='Row'>{temp}</h></>)
    )
  }
}
root.render(<Sudoku arr={sudoku} />)
